6cf02b21-f37e-484c-a35c-e72c9a4bcd15	welcome_email	Bem-vindo ao SongMetrix!	<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto; padding: 20px; border: 1px solid #e0e0e0; border-radius: 5px;">\r\n        <div style="text-align: center; margin-bottom: 20px;">\r\n            <img src="https://songmetrix.com.br/logo-1280x256.png" alt="SongMetrix Logo" style="max-width: 200px;">\r\n        </div>\r\n        <h1 style="color: #3b82f6; font-size: 24px;">Olá {{name}}!</h1>\r\n        <p style="font-size: 16px; line-height: 1.6; color: #333;">Bem-vindo ao SongMetrix, a plataforma completa para monitoramento e análise de execuções musicais nas rádios brasileiras.</p>\r\n        <p style="font-size: 16px; line-height: 1.6; color: #333;">Estamos muito felizes em ter você conosco! Com o SongMetrix, você terá acesso a:</p>\r\n        <ul style="font-size: 16px; line-height: 1.6; color: #333;">\r\n            <li>Monitoramento em tempo real de execuções</li>\r\n            <li>Rankings detalhados</li>\r\n            <li>Relatórios personalizados</li>\r\n            <li>Análise de desempenho de músicas</li>\r\n        </ul>\r\n        <p style="font-size: 16px; line-height: 1.6; color: #333;">Para começar, basta acessar sua conta usando o email <strong>{{email}}</strong> em <a href="https://songmetrix.com.br" style="color: #3b82f6;">songmetrix.com.br</a>.</p>\r\n        <div style="background-color: #f3f4f6; padding: 15px; border-radius: 5px; margin: 20px 0;">\r\n            <p style="margin: 0; font-size: 14px; color: #555;">Se tiver qualquer dúvida, não hesite em responder a este email ou entrar em contato pelo WhatsApp.</p>\r\n        </div>\r\n        <p style="font-size: 16px; line-height: 1.6; color: #333;">Atenciosamente,<br>Equipe SongMetrix</p>\r\n        <div style="text-align: center; margin-top: 30px; padding-top: 20px; border-top: 1px solid #e0e0e0; color: #666; font-size: 12px;">\r\n            <p>© 2025 SongMetrix - Todos os direitos reservados</p>\r\n            <p>Este email foi enviado em {{date}}</p>\r\n        </div>\r\n    </div>	f	2025-03-24 20:14:32.543044+00	2025-03-24 22:58:54.146+00
a9275be9-50cc-4843-b579-0ecd684f5e20	Boas Vindas	Bem Vindo(a) ao Songmetrix	<!DOCTYPE html>\n<html>\n<head>\n  <meta charset="utf-8">\n  <meta name="viewport" content="width=device-width, initial-scale=1.0">\n  <title>Bem-vindo ao SongMetrix</title>\n</head>\n<body style="margin: 0; padding: 0; font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif; background-color: #f9fafb; color: #333;">\n  <div style="max-width: 600px; margin: 0 auto; background-color: #fff; box-shadow: 0 4px 6px rgba(0,0,0,0.1); border-radius: 8px; overflow: hidden;">\n    <!-- Cabeçalho -->\n    <div style="background: linear-gradient(135deg, #3b82f6 0%, #2563eb 100%); padding: 30px 20px; text-align: center;">\n      <div style="font-size: 28px; font-weight: bold; color: white; letter-spacing: 1px;">SONGMETRIX</div>\n      <h1 style="color: white; margin-top: 20px; font-weight: 600; font-size: 24px;">Bem-vindo à nossa plataforma!</h1>\n    </div>\n    \n    <!-- Conteúdo -->\n    <div style="padding: 30px 20px;">\n      <p style="font-size: 16px; line-height: 1.6; margin-bottom: 20px;">Olá <strong>{{fullName}}</strong>,</p>\n      \n      <p style="font-size: 16px; line-height: 1.6; margin-bottom: 20px;">É com grande satisfação que damos as boas-vindas a você no <strong>SongMetrix</strong>, a plataforma líder em monitoramento e análise de execuções musicais nas rádios brasileiras.</p>\n      \n      <p style="font-size: 16px; line-height: 1.6; margin-bottom: 20px;">Estamos entusiasmados em tê-lo(a) como parte da nossa comunidade. Aqui, você terá acesso a ferramentas poderosas para acompanhar o desempenho das suas músicas no rádio brasileiro em tempo real.</p>\n      \n      <div style="background-color: #f3f4f6; padding: 20px; border-radius: 8px; margin: 25px 0;">\n        <h3 style="color: #2563eb; margin-top: 0; font-size: 18px;">O que você pode fazer no SongMetrix:</h3>\n        <ul style="padding-left: 20px; margin-bottom: 0;">\n          <li style="margin-bottom: 10px; font-size: 15px;"><strong>Monitoramento em tempo real</strong> de execuções musicais</li>\n          <li style="margin-bottom: 10px; font-size: 15px;"><strong>Rankings detalhados</strong> de músicas e artistas</li>\n          <li style="margin-bottom: 10px; font-size: 15px;"><strong>Relatórios personalizados</strong> com métricas exclusivas</li>\n          <li style="margin-bottom: 10px; font-size: 15px;"><strong>Análises comparativas</strong> para orientar suas estratégias</li>\n          <li style="font-size: 15px;"><strong>Alertas</strong> sobre novas execuções de seu interesse</li>\n        </ul>\n      </div>\n      \n      <p style="font-size: 16px; line-height: 1.6; margin-bottom: 20px;">Para começar a explorar todos esses recursos, acesse sua conta utilizando o email <strong>{{email}}</strong>.</p>\n      \n      <div style="text-align: center; margin: 30px 0;">\n        <a href="https://songmetrix.com.br/dashboard" style="display: inline-block; background-color: #2563eb; color: white; text-decoration: none; padding: 12px 30px; border-radius: 6px; font-weight: 600; font-size: 16px;">Acessar Minha Conta</a>\n      </div>\n      \n      <p style="font-size: 16px; line-height: 1.6;">Se tiver dúvidas ou precisar de ajuda, nossa equipe está à disposição para auxiliá-lo(a). Basta responder a este email ou entrar em contato pelo WhatsApp.</p>\n      \n      <p style="font-size: 16px; line-height: 1.6; margin-top: 30px;">Atenciosamente,</p>\n      <p style="font-size: 16px; font-weight: 600; margin-top: 5px; margin-bottom: 0;">Equipe SongMetrix</p>\n    </div>\n    \n    <!-- Rodapé -->\n    <div style="background-color: #f3f4f6; padding: 20px; text-align: center; border-top: 1px solid #e5e7eb;">\n      <p style="font-size: 14px; color: #6b7280; margin-top: 0;">© 2025 SongMetrix - Todos os direitos reservados</p>\n      <p style="font-size: 12px; color: #6b7280; margin-bottom: 0;">Email enviado em {{date}}</p>\n    </div>\n  </div>\n</body>\n</html>	t	2025-03-24 20:43:44.669529+00	2025-03-25 01:40:36.136+00
